import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import PopisBodova from './pages/PopisBodova'; // Pretpostavljamo da je PopisBodova komponenta u 'pages' direktoriju

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Aplikacija za lov</h1>
          <div className="Menu">
            <Button text="EVIDENCIJA LOVACA" />
            <Button text="RASPORED AKTIVNOSTI I LOVA" />
            <Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" />
            <Button text="UNOS DIVLJAČI" />
            <Button text="UNOS ODSTRIJELENE DIVLJAČI" />
            <Button link="/bodovi" text="BODOVI" />
          </div>
        </header>
        <Switch>
          <Route path="/bodovi">
            <PopisBodova />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Button({ link, text }) {
  return (
    <div className="Button">
      <Link to={link}>{text}</Link>
    </div>
  );
}

export default App;
